define("text!UI/Components/Intro/Intro.html", [], function () {
  return '<div id="intro" class="pt-page-fadeIn">\n\t<div class="intro">\n\n\t\t<div class="overlay loading">\n\t\t\t<span></span>\n\t\t\t<span></span>\n\t\t\t<span></span>\n\t\t</div>\n\n\t\t<div class="overlay about">\n\t\t\t<div class="title">\n\t\t\t\t<div class="icon"><img src="" width="65" height="64" alt="icon roBrowser"/></div>\n\t\t\t\t<div class="desc">\n\t\t\t\t\t<h1>roBrowser</h1>\n\t\t\t\t\t<h2>Open Source reproduction of Ragnar?k Online for the Web Browser</h2>\n\t\t\t\t</div>\n\t\t\t\t<div class="clear"></div>\n\t\t\t</div>\n\t\t\t<table class="info">\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Author:</td>\n\t\t\t\t\t<td>Vincent Thibault</td>\n\t\t\t\t</tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Site:</td>\n\t\t\t\t\t<td><a href="http://www.robrowser.com/" target="_blank">http://www.robrowser.com/</a></td>\n\t\t\t\t</tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Source:</td>\n\t\t\t\t\t<td><a href="http://www.github.com/vthibault/roBrowser/" target="_blank">http://www.github.com/vthibault/roBrowser/</a></td>\n\t\t\t\t</tr>\n\t\t\t</table>\n\t\t\t<div class="concept">\n\t\t\t\t<p>roBrowser is an open source project based on the game Ragnar?k Online.<br/>\n\t\t\t\tIt’s not affiliated in any way with Gravity.</p>\n\t\t\t\t<p>The concept is to reproduce the game using awesome new web technologies (HTML5, Javascript, WebGL) to bring it to Web Browsers.</p>\n\t\t\t\t<p>Since roBrowser runs in a web browser, it also means it’s cross-platform and can run with multiple OSes (Windows, Linux, Macintosh, ...) instead of the original client which was limited to Windows.<br/>\n\t\t\t\tIt should also run fine on other devices ( televisions, computers, smartphones, tablets) if the device supporst openGL ES 2.0 and is powerful enough to support the game.</p>\n\t\t\t</div>\n\t\t</div>\n\n\t\t<div class="overlay settings">\n\n\t\t\t<h1>Window Settings</h1>\n\t\t\t<table class="screen">\n\t\t\t\t<tr class="resolution">\n\t\t\t\t\t<td>Screen Resolution</td>\n\t\t\t\t\t<td colspan="2">\n\t\t\t\t\t\t<select class="screensize" style="width:150px">\n\t\t\t\t\t\t\t<option value="650x480">640 x 480</option>\n\t\t\t\t\t\t\t<option value="800x600">800 x 600</option>\n\t\t\t\t\t\t\t<option value="1024x768">1024 x 768</option>\n\t\t\t\t\t\t\t<option value="1280x800">1280 x 800</option>\n\t\t\t\t\t\t\t<option value="1400x900">1400 x 900</option>\n\t\t\t\t\t\t\t<option value="1680x1050">1680 x 1050</option>\n\t\t\t\t\t\t\t<option value="full">Full Screen</option>\n\t\t\t\t\t\t</select>\n\t\t\t\t\t</td>\n\t\t\t\t</tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Resolution Details</td>\n\t\t\t\t\t<td>\n\t\t\t\t\t\t<input class="quality" style="width:150px" type="range" value="100" max="100" min="25" step="25" />\n\t\t\t\t\t</td>\n\t\t\t\t\t<td class="quality_result">100%</td>\n\t\t\t\t</tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Cursor</td>\n\t\t\t\t\t<td>\n\t\t\t\t\t\t<label>\n\t\t\t\t\t\t\t<input class="cursor" type="checkbox" /> Show official cursor\n\t\t\t\t\t\t</label>\n\t\t\t\t\t</td>\n\t\t\t\t</tr>\n\t\t\t</table>\n\n\t\t\t<div>\n\t\t\t\t<h1>Full Client</h1>\n\t\t\t\t<table class="screen">\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td>\n\t\t\t\t\t\t\t<label>\n\t\t\t\t\t\t\t\t<input class="save" type="checkbox" /> Save Files\n\t\t\t\t\t\t\t</label>\n\t\t\t\t\t\t</td>\n\t\t\t\t\t\t<td>\n\t\t\t\t\t\t\t<button class="clean">Clean cache</button>\n\t\t\t\t\t\t</td>\n\t\t\t\t\t</tr>\n\t\t\t\t</table>\n\t\t\t</div>\n\t\t\t\n\t\t\t<h1>Sound</h1>\n\t\t\t<table class="sound">\n\t\t\t\t<tr>\n\t\t\t\t\t<td>BGM</td>\n\t\t\t\t\t<td>\n\t\t\t\t\t\t<input class="bgmvol" style="width:150px" type="range" value="50" max="100" min="0" step="25" />\n\t\t\t\t\t</td>\n\t\t\t\t\t<td class="bgmvol_result">50%</td>\n\t\t\t\t</tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td>Sound</td>\n\t\t\t\t\t<td>\n\t\t\t\t\t\t<input class="soundvol" style="width:150px" type="range" value="50" max="100" min="0" step="25" />\n\t\t\t\t\t</td>\n\t\t\t\t\t<td class="soundvol_result">50%</td>\n\t\t\t\t</tr>\n\t\t\t</table>\n\n\t\t\t<div class="serveredit">\n\t\t\t\t<h1>Server List</h1>\n\t\t\t\t<dl>\n\t\t\t\t\t<dt>\n\t\t\t\t\t\t<input class="radio serverdef" type="radio" value="serverfile" name="server"/>\n\t\t\t\t\t\t<span>Using clientinfo.xml file stored in my FullClient</span>\n\t\t\t\t\t</dt>\n\t\t\t\t\t<dd>data / <input type="text" value="clientinfo.xml" class="clientinfo"/></dd>\n\t\n\t\t\t\t\t<dt>\n\t\t\t\t\t\t<input class="radio serverdef" type="radio" value="serverlist" name="server"/>\n\t\t\t\t\t\t<span>Using servers from the current list :</span>\n\t\t\t\t\t</dt>\n\t\t\t\t\t<dd>\n\t\t\t\t\t\t<div class="servercontainer">\n\t\t\t\t\t\t\t<table class="serverlist">\n\t\t\t\t\t\t\t\t<thead>\n\t\t\t\t\t\t\t\t\t<tr>\n\t\t\t\t\t\t\t\t\t\t<td width="22%">Name</td>\n\t\t\t\t\t\t\t\t\t\t<td width="25%">Address</td>\n\t\t\t\t\t\t\t\t\t\t<td width="12%">Version</td>\n\t\t\t\t\t\t\t\t\t\t<td width="15%">Langtype</td>\n\t\t\t\t\t\t\t\t\t\t<td width="22%">Packet Version</td>\n\t\t\t\t\t\t\t\t\t\t<td width="10px">\n\t\t\t\t\t\t\t\t\t\t</td>\n\t\t\t\t\t\t\t\t\t</tr>\n\t\t\t\t\t\t\t\t</thead>\n\t\t\t\t\t\t\t\t<tbody class="servers">\n\t\t\t\t\t\t\t\t</tbody>\n\t\t\t\t\t\t\t</table>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<button class="btn_add"></button>\n\t\t\t\t\t\t<div class="clear"></div>\n\t\t\t\t\t</dd>\n\t\t\t\t</dl>\n\t\t\t</div>\n\n\t\t\t<button class="btn_save"></button>\n\t\t</div>\n\n\t\t<button class="btn_about">\n\t\t\t<img src="" width="48" height="51" alt="About roBrowser"/>\n\t\t</button>\n\n\t\t<div class="ribbon"></div>\n\t\t<div class="msg"></div>\n\t\t<div class="box"></div>\n\t\t<input type="file" multiple="multiple" directory="" webkitDirectory=""/>\n\n\t\t<button class="btn_play"></button>\n\n\t\t<button class="btn_settings">\n\t\t\t<img src="" width="60" height="60" alt="Parameters"/>\n\t\t</button>\n\n\t\t<canvas width="800" height="600"></canvas>\n\t</div>\n</div>\n'
});
